    def run do
        Logger.info("Loading #{__MODULE__} fixtures")
        projects = Project
        |> Project.titles(["Loto 1", "Loto 6"])
        |> Gt.Repo.all

        project_users = Enum.reduce(projects, [], fn (project, acc) ->
            acc ++ Enum.map(@project_users, &insert_project_user(project, &1))
        end)
        Mongo.insert_many(Gt.Repo.__mongo_pool__, ProjectUser.collection, project_users)
        Logger.info("Loaded #{__MODULE__} fixtures")
    end

    def insert_project_user(project, project_user) do
        [
            reg_past_days,
            last_past_days,
            first_dep_past_days,
            currency,
            email_unsub_types,
            email_valid,
            first_dep_amount,
            has_bonus,
            is_active,
            is_test,
            item_id,
            lang,
            phones,
            _,
            reg_ref1,
            segment,
            segment_upd_t,
            sms_unsub_types,
            _,
            query1,
            status,
            cash_real,
            cash_user_real
        ] = project_user
        reg_date = @now |> Timex.subtract(Time.to_timestamp(reg_past_days, :days))
        last_date = @now |> Timex.subtract(Time.to_timestamp(last_past_days, :days))
        first_dep_date = @now |> Timex.subtract(Time.to_timestamp(first_dep_past_days, :days))

        %{
            item_id: item_id,
            project: Gt.Model.object_id(project.id),
            email_valid: email_valid,
            lang: lang,
            currency: currency,
            is_active: is_active,
            is_test: is_test,
            has_bonus: has_bonus,
            query1: query1,
            reg_ref1: reg_ref1,
            reg_d: GtDate.format(reg_date, :date),
            reg_t: GtDate.timestamp(reg_date),
            last_d: GtDate.format(last_date, :date),
            last_t: GtDate.timestamp(last_date),
            status: status,
            segment: segment,
            segment_upd_t: segment_upd_t,
            first_dep_d: GtDate.format(first_dep_date, :date),
            first_dep_amount: first_dep_amount,
            email_unsub_types: email_unsub_types,
            sms_unsub_types: sms_unsub_types,
            phones: phones,
            cash_real: cash_real,
            cash_user_real: cash_user_real
        }
    end
